import React from 'react'

export default function Viewer(props) {
  return (
    <div style={{width: '96%'}} align="left">
            <h3>{props.title}</h3>
            <hr/>
            <div dangerouslySetInnerHTML={{__html: props.rawHtmlBody}}></div>
    </div>
  )
}
